package db.domain;import java.util.Arrays;public class BossDamageDataImpl implements BossDamageData {	@Key	private int bossId;	@Key	private String challengerId;	private int damage;	private boolean award;	public BossDamageDataImpl() {	}	public BossDamageDataImpl(BossDamageData c) {		this.bossId = c.getBossId();		this.challengerId = c.getChallengerId();		this.damage = c.getDamage();		this.award = c.getAward();	}	@Override	public String tableName() {		return "boss_damage_data";	}	public void setBossId(int bossId) {		this.bossId = bossId;	}	public int getBossId() {		return this.bossId;	}public void addBossId(int bossId) {		this.bossId += bossId;}	public void setChallengerId(String challengerId) {		this.challengerId = challengerId;	}	public String getChallengerId() {		return this.challengerId;	}public void addChallengerId(String challengerId) {		this.challengerId += challengerId;}	public void setDamage(int damage) {		this.damage = damage;	}	public int getDamage() {		return this.damage;	}public void addDamage(int damage) {		this.damage += damage;}	public void setAward(boolean award) {		this.award = award;	}	public boolean getAward() {		return this.award;	}}